import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const LocationMiddle = () => {
    return (
        <View style={styles.l_middle}>
            <View style={styles.l_miidle_box}></View>
dghdfh
        </View>
    );
}

const styles = StyleSheet.create({
    l_middle: {
        width: '375px',
        height: "400px",
        left: 0,
        top: 115,
        backgroundColor: "#fff",
        display:'inline-block'
    },
    l_miidle_box:{
        // position:'absolute',
        width:'375px',
        height:'200px',
        left:'0',
        top:'11px',
        backgroundColor:"#000",
        margin:'auto'

    }
})

export default LocationMiddle;
